import styled from 'styled-components'

const StyledHeader = styled.div`
  display: flex;
  background-color: black;
  color: #FFFFFF;
`

const Header = () => {
  return (
    <StyledHeader>
      <span>The rick and morty app</span>
    </StyledHeader>
  )
}

export default Header
